import './Home.css';
import '../App.css';
import './TypingDots.css';
import TypingDots from './TypingDots';

function Home() {
    return (
        <div className="home">
            <div className="home__left animated">
                <div class="home__text-container fade-in slide-in">
                    <h1>Kevin{' '}
                        <br className="break"/>
                    Cendana</h1>
                    <p>Computer Science Student</p>
                </div>
            </div>
            <div className  = "home__right">
                <div className  = "home__square1">


                <div id = "allSpeechBubblesWrapper" class="allSpeechBubblesWrapper initialSpeechBubblesContainer">
                    <div id="typingDots" class="typingDots" >
                        <div class="dot"></div>
                        <div class="dot"></div>
                        <div class="dot"></div>
                    </div>     
                    <div class="speechBubble speechBubble1" id="speechBubble"></div>
                    <div class="speechBubble"></div>
                </div>


                </div>
                <div className  = "home__square2">
                </div>
            </div>
        </div>
    );
}

export default Home;
